import { CustomCommand } from 'reactotron-core-client';
import { ClientActions } from '~/logic/client/ClientRedux';
import { ProfileActions } from '~/logic/profile/ProfileRedux';
import { store } from '~/store/store';

const GetSelfProducts: CustomCommand = {
    command: 'GetSelfProducts',
    handler: () => {
        store.dispatch(
            ProfileActions.getSelfProducts.request({ index: "1" })
        )
    }
};

const SetPhotoProfile: CustomCommand = {
    command: 'SetPhotoProfile',
    handler: () => {
        store.dispatch(
            ProfileActions.setProfilePhoto.request({ data: 'data:image/jpeg;base64,', mimeType: `image/jpeg` })
        )
    }
};

const commands = [
    GetSelfProducts,
    SetPhotoProfile
];

export { commands };
